style.css:
@-moz-document url-prefix("https://spb257.eljur.ru") {
.dnevnik-day:nth-child(n) .dnevnik-lesson:nth-child(n) .dnevnik-lesson__task {
  color: white;
}
.dnevnik-day:nth-child(n) .dnevnik-lesson:nth-child(n) .js-rt_licey-dnevnik-subject {
  color: white;
}
.dnevnik-day:nth-child(n) .dnevnik-lesson:nth-child(n) > .dnevnik-lesson__number {
  color: white;
}

html, .layout-main, #footer, .ej-info-block, .page-empty,
.navigation-header, #navigation-tabs,
.messages-item:nth-child(n) > .messages-item__title,
.messages-item:nth-child(n) .messages-item__link,
.messages-item:nth-child(n) .messages-item__author,
.messages-item:nth-child(n) > .messages-item__check,
.messages-header, .field,
.messages-item:nth-child(n) > .messages-item__date,
.column-auto:nth-child(n) .ej-select__header,
.column-auto:nth-child(n),
.dnevnik-day:nth-child(n) .dnevnik-lesson:nth-child(n),
.cell:nth-child(n) > .text-overflow,
.grid-header-controls, 
.dnevnik-day:nth-child(n) > .dnevnik-day__header,
#dnevnik-header .navigation-tabs__inner {
	color: white;
	background-color: black;
}
.page-title, .logotype__title {
	color: white;
}
}
